import './App.css';
import React,{ Component } from 'react';
import Customer from './components/Customer';
import Table from '@material-ui/core/Table';
import TableHead from '@material-ui/core/TableHead';
import TableBody from '@material-ui/core/TableBody';
import TableRow from '@material-ui/core/TableRow'
import TableCell from '@material-ui/core/TableCell'


const customer = [
  {
    'id': 1,
    'image' : 'https: //placeimg.com/64/64/1',
    'name' : '김민수',
    'birthday' : '961222',
    'gender' : '남자',
    'job' : '개발자' 
  },
  {
    'id': 2,
    'image' : 'https: //placeimg.com/64/64/2',
    'name' : '박현규',
    'birthday' : '930412',
    'gender' : '남자',
    'job' : '프로그래머' 
  },
  {
    'id': 3,
    'image' : 'https: //placeimg.com/64/64/3',
    'name' : '한연수',
    'birthday' : '090822',
    'gender' : '여자',
    'job' : '디자이너' 
  }
]

class App extends Component {
  render(){
    return (
      <div>
        <Table>
          <TableHead>
            <TableRow>
              <TableCel>번호</TableCel>
              <TableCel>이미지</TableCel>
              <TableCel>이름</TableCel>
              <TableCel>생년월일</TableCel>
              <TableCel>성별</TableCel>
              <TableCel>직업</TableCel>
            </TableRow>
          </TableHead>

          <TableBody>

          {customer.map(c =>  { return ( <Customer  key = {c.id } id = {c.id } image = {c.image} name ={c.name } birthday ={c.birthday}  gender ={c.gender} job ={c.job}> </Customer>)})}

          </TableBody>
        </Table>
      </div>
    );
  }
}

export default App;
